Theme62.blog.comment.reply = function(obj){
  for (var prop in obj){
    if (obj.hasOwnProperty(prop)){
      var content = document.getElementById(prop);
      if (obj[prop]){
        content.setAttribute('hidden', '');
      } else {
        content.removeAttribute('hidden');
        if (content.src != content.dataset.src){
          var ifr = document.getElementById(content.id);
          content.src = content.dataset.src;
          content.onload = function(){ifr.style.background = 'transparent'};
        }
      }
    }
  }
}

